import Todo from "./Todo";

function TodoList({todos, removeTodo, updateTodo}) {


  return (
    <>
      {todos.map( todo => {
        return <Todo todo={todo} updateTodo={updateTodo} removeTodo={removeTodo} />
      })}
    </>
  );
}

export default TodoList;
